import React, { Component } from 'react';

import AppHeader from '../header/header';

import Grid from '../grid/grid';


import './app.css';


export default class App extends Component {
    state = {
        leftData: [
            {id: 0, title: 'Left 0'},
            {id: 1, title: 'Left 1'},
            {id: 2, title: 'Left 2'},
        ],
        middleData: [
            {id: 3, title: 'Middle 0'},
            {id: 4, title: 'Middle 1'},
            {id: 5, title: 'Middle 2'},
        ],
        rightData: [
            {id: 6, title: 'Right 0'},
            {id: 7, title: 'Right 1'},
            {id: 8, title: 'Right 2'},
        ]
    };

    onMoveLeft(id){console.log(id)};
    onMoveRight(id){console.log(id)};
    
    render() {
        
        return  (
        <div className="row col-md-4">
            
            <Grid 
            onMoveLeft={this.onMoveLeft}
            onMoveRight = {this.onMoveRight}
            items= {this.state.leftData}>

            </Grid>
            <Grid 
            onMoveLeft={this.onMoveLeft}
            onMoveRight = {this.onMoveRight}
            items= {this.state.middleData}>

            </Grid>
            <Grid 
            onMoveLeft={this.onMoveLeft}
            onMoveRight = {this.onMoveRight}
            items= {this.state.rightData}>

            </Grid>
        </div>
        );
          
      };
}
